import React from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import './nav.css';

function Nav(props) {
  var navMap = props.locales;


  return (
    <div class="navbar">
        <ul class="nav">
          <li>
            <a class="nav-link" href="/">Home</a>
          </li>
          <li>
            <a class="nav-link" href="/micros/">Microgreens</a>
          </li>
          <li>
            <a class="nav-link" href="/natives/">Native Plants</a>
          </li>
          <li>
            <a class="nav-link" href="/team/">Team</a>
          </li>
        </ul>
      </div>
  );
}

export default Nav;
